var str = tmpStr.substring(1, tmpStr .length-1);

var obj = JSON.parse(str);

outputs.u_id = obj.inventory_update;
outputs.u_status = obj.status;
outputs.u_inventory_source = obj.inventory_source;





})(inputs, outputs);

